:root {
      --nwidth: 100%;   /* Definimos la variable */
    }

   .ribbon{
      border:0px;
      background-color: blue;
      height: 80px;
      width: var(--nwidth);   /* Utilizamos la variable */
      overflow-x:hidden;
      overflow-y: hidden;
   }
   .panel{
      background-color: white;
      height: 50px;
      width: calc( var(--nwidth) / 2 );  /* Usamos la variable para realizar un cálculo */
      visibility: hidden;
      position: absolute;
   }

